css:
@-moz-document domain(yoyz.com) {
  body, .tabcontents {
      background-color: #222 !important;
      color: #eee;
  }

  .title a {
      color: #a0a0a0;
  }

  .noborder {
      background-color: #222 !important;
      color: #eee;
  }

  .tableheader, h4 {
      background-color: #222 !important;
      color: #eee !important;
  }

  table.critter tr.dead td {
      border: 1px solid #333;
  }

  table.critter tr.alt {
      background-color: #2f2f2f !important;
      color: #eee !important;
  }

  table.critter tr.newest {
      background-color: #3e3c32 !important;
      color: #eee !important;
  }

  table.critter.female th {
      background-color: #530d17!important;
  }

  table.critter.male th {
      background-color: #07054d!important;
  }

  table.critter.mine td.mine, table.critter.carrier td.carry, table.critter.farm td.farm, table.critter.factory td.factory {
      background-color: #6b665f!important;
  }

  table.map td.fog {
      background-color: #424242;
  }

  table.map td.unlocked {
      background-color: #2f2f2f;
  }

  table.critter tr.attacker {
      background-color: #5d6b5e !important;
  }

  table.critter tr.defender {
      background-color: #695c5c !important;
  }

  td.clear1, td.clear2, td.clear3, td.clear4, td.clear5, td.clear6, td.clear7, td.clear8, td.clear9 {
      color: #000;
  }

  table.critter.mine th {
      background-color: #8f7d60;
  }

  table.critter.carrier th {
      background-color: #7c3a21;
  }

  table.critter.farm th {
      background-color: #6f8253;
  }

  table.critter.factory th {
      background-color: #585577;
  }

  .tpd-skin-dark .tpd-content, .tpd-skin-dark .tpd-title, .tpd-skin-dark .tpd-close {
      color: #eee;
      background-color: #111;
  }

  table.critter th {
      background-color: #535353;
  }
}
